let playSound = (soundId, loop) => {
  var audio = document.getElementById(soundId);
  if (loop) {
    audio.style.loop = "loop";
  }
  audio.play();
};

let pauseSound = (soundId) => {
  var audio = document.getElementById(soundId);
  audio.pause();
  audio.style.loop = "";
  audio.currentTime = 0;
};

